Here is a Python function to find common elements in given nested lists:

```python
def common_in_nested_lists(nested_list):
    # Convert the nested lists into a single list
    flat_list = [item for sublist in nested_list for item in sublist]

    # Create a dictionary to count the occurrence of each element
    count_dict = {}
    for item in flat_list:
        if item in count_dict:
            count_dict[item] += 1
        else:
            count_dict[item] = 1

    # Return the elements that appear in all lists
    return [item for item, count in count_dict.items() if count == len(nested_list)]
```

This function works by first flattening the nested list into a single list. Then it counts the occurrence of each element in the flattened list. Finally, it returns the elements that appear in all nested lists.

